var $bm_rt;
var rawAmount, compareAmount, nervousness, targetScale, noiseResult;
rawAmount = effect('Scale Bounce - random')('Chance of Bouncing');
compareAmount = $bm_div($bm_sub(50, rawAmount), 50);
nervousness = $bm_div(effect('Scale Bounce - random')('Bounce Nervousness'), 20);
targetScale = effect('Scale Bounce - random')('Target Scale Change');
noiseResult = noise($bm_mul(time, nervousness));
$bm_rt = linear(noiseResult, compareAmount, 1, 100, targetScale);
